CREATE TABLE "Ubicacion"(
   id_ubicacion      INTEGER  NOT NULL PRIMARY KEY 
  ,utmwgs            VARCHAR(3)
  ,"latitudX"          NUMERIC(16,9) NOT NULL
  ,"longitudY"         NUMERIC(14,8) NOT NULL
  ,cordinate         VARCHAR(3)
  ,altitud           INTEGER 
  ,"altitudMin"        INTEGER 
  ,"altitudMax"        INTEGER 
  ,id_localidad_id   INTEGER  NOT NULL
  ,id_ave            INTEGER  NOT NULL
);
